</h4><div><p>Acunetix, will be exhibiting at CeBIT, Sydney Olympic Park, Australia between 5-7 May 2015. Register Now with Promo Code acundk, selecting the expo+ pass to receive: A complimentary entry to the expo Access to one campus session Complimentary train ticket to/from Sydney Olympic Park. What&#8217;s On at CeBIT 2015? Connect with global thought leaders at the [&#8230;]\n<p><a href=\"http://www.acunetix.com/blog/events/acunetix-attending-cebit-2015-in-sydney/\">Read More &#8594;</a></p>\n<p>The post <a rel=\"nofollow\" href=\"http://www.acunetix.com/blog/events/acunetix-attending-cebit-2015-in-sydney/\">Acunetix attending CeBIT 2015 in Sydney</a> appeared first on <a rel=\"nofollow\" href=\"http://www.acunetix.com\">Acunetix</a>.</p><img src=\"http://feeds.feedburner.com/~r/acunetixwebapplicationsecurityblog/~4/f65RAGrdwJc\" height=\"1\" width=\"1\" alt=\"\" /></div></li><li><h4><a href=\"http://feeds.acunetix.com/~r/acunetixwebapplicationsecurityblog/~3/86E66ipANkY/\" target=\"_blank\" title=\"Posted on April 9, 2015 | 8:27 am\">Acunetix Network Scans defend against Trojans and Backdoors</a></h4><div><p>The task of keeping the systems running on the network perimeter and all the services exposed on the internet is substantial and ongoing. Considering that most network admins are time-starved, they can’t always be blamed for missing the latest security update for their software. A network security scan from the online version of Acunetix Vulnerability Scanner [&#8230;]\n<p><a href=\"http://www.acunetix.com/blog/articles/acunetix-network-scans-trojans-and-backdoors/\">Read More &#8594;</a></p>\n<p>The post <a rel=\"nofollow\" href=\"http://www.acunetix.com/blog/articles/acunetix-network-scans-trojans-and-backdoors/\">Acunetix Network Scans defend against Trojans and Backdoors</a> appeared first on <a rel=\"nofollow\" href=\"http://www.acunetix.com\">Acunetix</a>.</p><img src=\"http://feeds.feedburner.com/~r/acunetixwebapplicationsecurityblog/~4/86E66ipANkY\" height=\"1\" width=\"1\" alt=\"\" /></div></li><li><h4><a href=\"http://feeds.acunetix.com/~r/acunetixwebapplicationsecurityblog/~3/n3rAkphedlA/\" target=\"_blank\" title=\"Posted on March 25, 2015 | 10:24 am\">Lessons to Learn from the AllCrypt Hack</a></h4><div><p>On March 18, 2015, AllCrypt, a small crypto currency exchange posted what may very well be one of their last posts on their blog. The Bitcoin exchange had been hacked, resulting in stolen crypto currency. The AllCrypt Team described the attack in detail in their blog post. The attacker managed to somehow get access to [&#8230;]\n<p><a href=\"http://www.acunetix.com/blog/articles/lessons-to-learn-from-the-allcrypt-hack/\">Read More &#8594;</a></p>\n<p>The post <a rel=\"nofollow\" href=\"http://www.acunetix.com/blog/articles/lessons-to-learn-from-the-allcrypt-hack/\">Lessons to Learn from the AllCrypt Hack</a> appeared first on <a rel=\"nofollow\" href=\"http://www.acunetix.com\">Acunetix</a>.</p><img src=\"http://feeds.feedburner.com/~r/acunetixwebapplicationsecurityblog/~4/n3rAkphedlA\" height=\"1\" width=\"1\" alt=\"\" /></div></li><li><h4><a href=\"http://feeds.acunetix.com/~r/acunetixwebapplicationsecurityblog/~3/wSzEAQTh8H4/\" target=\"_blank\" title=\"Posted on March 23, 2015 | 9:17 am\">Cyber Security and the Data Protection Act</a></h4><div><p>Records management company Iron Mountain have just published a report on public sector agencies, revealing that around 40% have suffered a data breach. It also noted that information security teams are under-resourced, lacking in the required skills or are performing roles above their grade. Considering the legal implications of a breach, let alone the potential [&#8230;]\n<p><a href=\"http://www.acunetix.com/blog/articles/cyber-security-and-the-data-protection-act/\">Read More &#8594;</a></p>\n<p>The post <a rel=\"nofollow\" href=\"http://www.acunetix.com/blog/articles/cyber-security-and-the-data-protection-act/\">Cyber Security and the Data Protection Act</a> appeared first on <a rel=\"nofollow\" href=\"http://www.acunetix.com\">Acunetix</a>.</p><img src=\"http://feeds.feedburner.com/~r/acunetixwebapplicationsecurityblog/~4/wSzEAQTh8H4\" height=\"1\" width=\"1\" alt=\"\" /></div></li><li><h4><a href=\"http://feeds.acunetix.com/~r/acunetixwebapplicationsecurityblog/~3/NzavG3y28mQ/\" target=\"_blank\" title=\"Posted on March 17, 2015 | 8:04 am\">Revamped Acunetix partner program brings online security opportunity to channel</a></h4><div><p>A rapidly growing market, generous margins and free use of product for all partners London, 17 March 2015 &#8211; Website security expert Acunetix is expanding its partner program to include not only software resellers, but also professionals such as website providers, developers and designers. All websites need to be secure, therefore anyone involved in creating [&#8230;]\n<p><a href=\"http://www.acunetix.com/blog/news/acunetix-partner-program-brings-online-security-opportunity-to-channel/\">Read More &#8594;</a></p>\n<p>The post <a rel=\"nofollow\" href=\"http://www.acunetix.com/blog/news/acunetix-partner-program-brings-online-security-opportunity-to-channel/\">Revamped Acunetix partner program brings online security opportunity to channel</a> appeared first on <a rel=\"nofollow\" href=\"http://www.acunetix.com\">Acunetix</a>.</p><img src=\"http://feeds.feedburner.com/~r/acunetixwebapplicationsecurityblog/~4/NzavG3y28mQ\" height=\"1\" width=\"1\" alt=\"\" /></div></li><li><h4><a href=\"http://feeds.acunetix.com/~r/acunetixwebapplicationsecurityblog/~3/tAjtkc3JfbE/\" target=\"_blank\" title=\"Posted on March 16, 2015 | 9:47 am\">Political hacking – the latest cyber threat</a></h4><div><p>Regardless if you believe North Korea were the culprits or not, everyone will acknowledge that since the Sony hack, we’ve all started to take cyber terrorism a little more seriously. You mean they don’t just want financial details and government intelligence? No, that’s right, terrorists are creative and now the whole world is hooked up [&#8230;]\n<p><a href=\"http://www.acunetix.com/blog/articles/political-hacking/\">Read More &#8594;</a></p>\n<p>The post <a rel=\"nofollow\" href=\"http://www.acunetix.com/blog/articles/political-hacking/\">Political hacking &#8211; the latest cyber threat</a> appeared first on <a rel=\"nofollow\" href=\"http://www.acunetix.com\">Acunetix</a>.</p><img src=\"http://feeds.feedburner.com/~r/acunetixwebapplicationsecurityblog/~4/tAjtkc3JfbE\" height=\"1\" width=\"1\" alt=\"\" /></div></li><li><h4><a href=\"http://feeds.acunetix.com/~r/acunetixwebapplicationsecurityblog/~3/4Re_K3YHueY/\" target=\"_blank\" title=\"Posted on March 11, 2015 | 1:49 pm\">Acunetix heading to RSA Conference 2015</a></h4><div><p>This year Acunetix are travelling to San Francisco to participate in the RSA Conference 2015. This week-long conference is annually attended by over 28,000 security professionals, making it the leading information security event in the world. Those attending will be able to meet Acunetix security experts face-to-face and find out what effective web vulnerability detection can do for [&#8230;]\n<p><a href=\"http://www.acunetix.com/blog/events/acunetix-heading-rsa-conference-2015/\">Read More &#8594;</a></p>\n<p>The post <a rel=\"nofollow\" href=\"http://www.acunetix.com/blog/events/acunetix-heading-rsa-conference-2015/\">Acunetix heading to RSA Conference 2015</a> appeared first on <a rel=\"nofollow\" href=\"http://www.acunetix.com\">Acunetix</a>.</p><img src=\"http://feeds.feedburner.com/~r/acunetixwebapplicationsecurityblog/~4/4Re_K3YHueY\" height=\"1\" width=\"1\" alt=\"\" /></div></li><li><h4><a href=\"http://feeds.acunetix.com/~r/acunetixwebapplicationsecurityblog/~3/y6ODMGqqAmo/\" target=\"_blank\" title=\"Posted on March 10, 2015 | 9:51 am\">Acunetix Voted Windowsecurity.com Readers’ Choice Award Winner</a></h4><div><p>March 10, 2015 – Leading Windows Security resource site, WindowSecurity.com, announced today that Acunetix was selected the winner in the Preferred Web Application Security Solution category of the WindowSecurity.com Readers’ Choice Awards. “Our Readers’ Choice Awards give visitors to our site the opportunity to vote for the products they view as the very best in [&#8230;]\n<p><a href=\"http://www.acunetix.com/blog/news/acunetix-windowsecurity-award-winner/\">Read More &#8594;</a></p>\n<p>The post <a rel=\"nofollow\" href=\"http://www.acunetix.com/blog/news/acunetix-windowsecurity-award-winner/\">Acunetix Voted Windowsecurity.com Readers’ Choice Award Winner</a> appeared first on <a rel=\"nofollow\" href=\"http://www.acunetix.com\">Acunetix</a>.</p><img src=\"http://feeds.feedburner.com/~r/acunetixwebapplicationsecurityblog/~4/y6ODMGqqAmo\" height=\"1\" width=\"1\" alt=\"\" /></div></li><li><h4><a href=\"http://feeds.acunetix.com/~r/acunetixwebapplicationsecurityblog/~3/cgAdXJvnWUA/\" target=\"_blank\" title=\"Posted on March 10, 2015 | 8:46 am\">Acunetix Deliver Talk to OWASP Charlotte Chapter</a></h4><div><p>This Thursday 12 March, Acunetix Technical and QA Engineer Ian Muscat will be delivering a talk to the OWASP Charlotte Chapter. The focus of his talk will be on automated dynamic web application security testing, which is naturally his area of expertise. The talk will explore various techniques employed by dynamic scanners in order to [&#8230;]\n<p><a href=\"http://www.acunetix.com/blog/events/talk-to-owasp-charlotte-chapter/\">Read More &#8594;</a></p>\n<p>The post <a rel=\"nofollow\" href=\"http://www.acunetix.com/blog/events/talk-to-owasp-charlotte-chapter/\">Acunetix Deliver Talk to OWASP Charlotte Chapter</a> appeared first on <a rel=\"nofollow\" href=\"http://www.acunetix.com\">Acunetix</a>.</p><img src=\"http://feeds.feedburner.com/~r/acunetixwebapplicationsecurityblog/~4/cgAdXJvnWUA\" height=\"1\" width=\"1\" alt=\"\" /></div></li><li><h4><a href=\"http://feeds.acunetix.com/~r/acunetixwebapplicationsecurityblog/~3/G0lbyzRUXJA/\" target=\"_blank\" title=\"Posted on March 9, 2015 | 8:09 am\">Troubleshooting tips for Apache, Part 4 – Run Apache HTTP Server as a single process</a></h4><div><p>Run Apache HTTP Server as a single process and use debugging tools A typical Apache HTTP Server installation runs with several processes. However, to simplify troubleshooting it’s best to run Apache as a single process. This can be done by using the X option when starting Apache. The example below will start Apache in a [&#8230;]\n<p><a href=\"http://www.acunetix.com/blog/articles/run-apache-http-server-as-a-single-process/\">Read More &#8594;</a></p>\n<p>The post <a rel=\"nofollow\" href=\"http://www.acunetix.com/blog/articles/run-apache-http-server-as-a-single-process/\">Troubleshooting tips for Apache, Part 4 &#8211; Run Apache HTTP Server as a single process</a> appeared first on <a rel=\"nofollow\" href=\"http://www.acunetix.com\">Acunetix</a>.</p><img src=\"http://feeds.feedburner.com/~r/acunetixwebapplicationsecurityblog/~4/G0lbyzRUXJA\" height=\"1\" width=\"1\" alt=\"\" /></div></li><div style=\"border-top: solid 1px #ccc; margin-top: 4px; padding: 2px 0;\"><p style=\"margin: 5px 0 0 0; padding: 0 0; line-height: normal; overflow: hidden;\"><a href=\"http://feeds.acunetix.com/acunetixwebapplicationsecurityblog\"\r\n                                    style=\"float: left; display: block; width: 50%; text-align: right; margin-left: 30px;\r\n                                    padding-right: 22px; background: url(\'rss.png\') no-repeat right center;\"\r\n                                    target=\"_blank\">Follow us on RSS</a></p></div>\";}','yes'),(1691,'wp_rocket_settings','a:39:{s:12:\"consumer_key\";s:8:\"9859cea3\";s:14:\"consumer_email\";s:19:\"js.klein@jetpulp.fr\";s:10:\"secret_key\";s:8:\"1cc40eae\";s:7:\"license\";s:10:\"1429102797\";s:16:\"secret_cache_key\";s:22:\"552e60bb1d43f730581738\";s:14:\"minify_css_key\";s:22:\"552e61464cb10039388137\";s:13:\"minify_js_key\";s:22:\"552e61464cb10197871830\";s:7:\"version\";s: