-06 08:50:57','2014-06-06 07:50:57','',11,'http://wp-maestro.laurent.jetpulp.dev/11-revision-v1/',0,'revision','',0),(13,3,'2014-06-06 08:52:13','2014-06-06 07:52:13','<span style=\"color: #444444;\">[wp_sitemap_page]</span>','Plan du site','','inherit','closed','closed','','9-revision-v1','','','2014-06-06 08:52:13','2014-06-06 07:52:13','',9,'http://wp-maestro.laurent.jetpulp.dev/9-revision-v1/',0,'revision','',0),(14,3,'2014-06-06 11:05:12','2014-06-06 10:05:12','<h2>Modèle titre h2</h2>\r\n<h3>Modèle titre h3</h3>\r\n<h4>Modèle titre h4</h4>\r\nAccenderat super his incitatum propositum ad nocendum aliqua mulier vilis, quae ad <a href=\"http://#\">palatium ut poposcerat</a> intromissa insidias ei latenter obtendi prodiderat a militibus obscurissimis. quam Constantina exultans ut in tuto iam locata mariti salute muneratam vehiculoque inpositam per regiae ianuas emisit in publicum, ut his inlecebris alios quoque ad indicanda proliceret paria vel maiora.\r\n<ul>\r\n	<li>incitatum propositum</li>\r\n	<li>salute muneratam</li>\r\n	<li>his inlecebris\r\n<ul>\r\n	<li>aliqua mulier</li>\r\n	<li>latenter obtendi</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n&nbsp;\r\n\r\n<a class=\"btn-1\" href=\"http://www.jetpulp.fr\" target=\"_blank\">Modèle de bouton</a>\r\n\r\n<hr />\r\n\r\nModèle colonnes (50/50)\r\n<div class=\"all-columns\">\r\n<div class=\"one-half first\">\r\n\r\n<img class=\"alignleft\" src=\"http://lorempixel.com/output/abstract-q-g-100-100-9.jpg\" alt=\"\" width=\"100\" height=\"100\" />Quod cum ita sit, paucae domus studiorum seriis cultibus antea celebratae nunc ludibriis ignaviae torpentis exundant, vocali sonu, perflabili tinnitu fidium resultantes. denique pro philosopho cantor et in locum oratoris doctor artium ludicrarum accitur et bybliothecis sepulcrorum ritu in perpetuum clausis organa fabricantur hydraulica, et lyrae ad speciem carpentorum ingentes tibiaeque et histrionici gestus instrumenta non levia.\r\n\r\n</div>\r\n<div class=\"one-half\">\r\n\r\n<img cla